import React from 'react';
import SelectedDate from '../../components/date/SelectedDate';

export default function Tarih({startDate, endDate, onChangeHandlerStart, onChangeHandlerEnd}) {
    return (
                        <div className="row mt-3">
                            <div className="col-12 col-lg-6 text-center">
                                <div>
                                    <label htmlFor="startDate" 
                                    className="px-1 ">Görev Başl. Tarihi</label> 
                                </div>
                                <SelectedDate 
                                    minDate={new Date("1923/01/01")}
                                    maxDate={new Date() && endDate}
                                    id="startDate"
                                    date={startDate}
                                    onChangeHandler={onChangeHandlerStart}/>
                            </div>
                            <div className="col-12 col-lg-6 text-center">
                                <div>
                                   <label htmlFor="endDate" 
                                    className="px-1">Görev Bitiş Tarihi</label> 
                                </div>
                                <SelectedDate 
                                    minDate={new Date("1923/10/29") && startDate}
                                    maxDate={new Date()}
                                    id="endDate"
                                    date={endDate}
                                    onChangeHandler={onChangeHandlerEnd}/>
                            </div>
                        </div>
    )
}
